Le mandarin (/mɑ̃.da.ʁɛ̃/ ; chinois simplifié : 官话 ; chinois traditionnel : 官話 ; pinyin : guān huà, « langue des officiels », chinois simplifié : 北方话 ; chinois traditionnel : 北方話 ; pinyin : běifāng huà, « parlers du Nord »), parfois sous les termes chinois voire pékinois, est une catégorie des langues chinoises parlée dans le nord-est et le sud-ouest de la Chine continentale. Envisagée comme une langue, c'est celle qui compte le plus grand nombre de locuteurs natifs dans le monde. Il s'écrit au moyen des sinogrammes et on le transcrit maintenant le plus souvent en pinyin, mais aussi en zhuyin (bopomofo). Même s'il est maintenant enseigné à tous les Chinois, certains Chinois plus âgés ne parlent pas le mandarin mais d'autres langues chinoises, comme le cantonais. Le mandarin, que les dirigeants communistes ont désigné comme la langue véhiculaire de leur nation entière en une version standardisée (dénommée 普通話 pǔtōnghuà, « langue commune »), était d'abord celle de communautés chinoises du nord du pays. Bien que possédant une ancienne histoire littéraire, elle ne dérive pas de la langue écrite classique littéraire et artificielle (文言 wényán), abandonnée en 1919 après avoir été utilisée comme langue écrite officielle et littéraire pendant plus de deux mille ans : en effet, c'est d'une langue vernaculaire parlée (白話 báihuà, « langue simple ») que le mandarin procède. En français comme dans les langues européennes, le mandarin fait référence à deux concepts distincts : 
* le chinois standard ou mandarin standard (Pǔtōnghuà/Zhōngwén/Guóyǔ/Huáyǔ/Hànyǔ), qui est basé sur le dialecte mandarin de Pékin. Le mandarin standard est la langue officielle en République populaire de Chine, en République de Chine (Taïwan) et l'une des quatre langues de Singapour. Le chinois, en pratique le mandarin standard, est une des six langues officielles des Nations unies ; 
* les différents dialectes parlés au nord, au centre et au sud-est de la Chine continentale. Ce groupe de dialectes est l'objet du présent article. En 1956, c'est la variante de Pékin qui est promue au rang de langue officielle. On la considère souvent comme la variante standard de cette langue. Le mandarin de Pékin possède cependant des spécificités (comme l'utilisation fréquente de la rétroflexion vocalique notée au moyen du suffixe -er) et on dit souvent que les Pékinois ont un « accent ». Le mandarin d'un Taïwanais est donc un peu différent de celui d'un Pékinois. En dehors de la Chine d'importantes communautés chinoises partagent cette langue, qui est enseignée dans de nombreux lycées et universités de par le monde. Comme les autres langues chinoises, c'est une langue à tons. Elle utilise quatre tonèmes, qui changent le sens du mot, haut et plat, montant, descendant légèrement puis remontant (modulé) et descendant. Les tons sont représentés en Chine par les accents sur les voyelles des syllabes de l'écriture romanisée dite pinyin et, à Taïwan, par les mêmes accents sur les graphèmes du bopomofo. On utilise aussi le numéro du ton à la fin de la syllabe quand les contraintes techniques empêchent d'entrer ou de lire les accents. Au quotidien, « mandarin » fait généralement référence au mandarin standard (Putonghua/Guoyu). À l'étranger, le mandarin constitue un groupe de dialectes, dont l'intelligibilité mutuelle est variable. Ce groupe de parlers est l'objet d'une reconnaissance établie chez les linguistes mais qui n'est pas nécessairement reconnue en dehors des cercles académiques. Lorsqu'on interroge un locuteur d'un dialecte mandarin, il ne reconnaîtra pas normalement qu'il parle une variante du mandarin mais sa variante locale (dialecte du Sichuan, dialecte du nord-est, etc.), en le considérant comme différent du « mandarin standard » (pǔtōnghuà). Il n'aura pas nécessairement conscience que les linguistes classent leur dialecte comme une forme du « mandarin » au sens linguistique ou vu de l'étranger.
